import {React , use} from "react";
import "../App.css";
import { useNavigate } from "react-router-dom";

const SignUp = () => {
  const navigate = useNavigate();
  const [message, setmessage] = useState("");

  const emailsaved = (email) => {
    axios
      .get(`http://localhost:4000/api/users/getbyemail/${email}`)
      .then((result) => {
        return result.data;
      })
      .catch((error) => {
        return false;
      });
  };
  const validateEmail = (email) => {
    const re = /\S+@\S+\.\S+/;
    return re.test(email);
  };
  const verif = (obj) => {
    if (obj.name.length === 0 || obj.name.includes("123456789")) {
    } else if (obj.email.length === 0 || !validateEmail(obj.email)) {
      setmessage("Invalid Email. Please enter a valid email address.");
    } else if (obj.password.length < 8) {
      setmessage(
        "Invalid Password. Please enter a password with a minimum of 8 characters."
      );
    } else if (obj.password !== obj.confirmpass) {
      setmessage("confirm your password correctly");
    } else if (emailsaved(obj.email).length === 0) {
      setmessage("email exist ! try another one");
    } else {
      axios
        .post(`http://localhost:4000/api/users/adduser`, {
          userName: obj.userName,
          email: obj.email,
          password: obj.password,
          imageUrl: obj.imageUrl,
          githubLink: obj.githubLink,
        })
        .then((result) => {
          return true;
        })
        .catch((error) => {
          console.log(error);
        });
    }
  };

  return (
    <form class="form">
      <p class="title">Register </p>
      <p class="message">Signup now and get full access to our app. </p>
      <div class="flex">
        <label>
          <input
            id="fName"
            required=""
            placeholder=""
            type="text"
            class="input"
          />
          <span>Firstname</span>
        </label>

        <label>
          <input
            id="lName"
            required=""
            placeholder=""
            type="text"
            class="input"
          />
          <span>Lastname</span>
        </label>
      </div>

      <label>
        <input
          id="email"
          required=""
          placeholder=""
          type="email"
          class="input"
        />
        <span>Email</span>
      </label>

      <label>
        <input
          id="pass"
          required=""
          placeholder=""
          type="password"
          class="input"
        />
        <span>Password</span>
      </label>
      <label>
        <input
          id="cpass"
          required=""
          placeholder=""
          type="password"
          class="input"
        />
        <span>Confirm password</span>
      </label>
      <label>
        <input
          id="img"
          required=""
          placeholder=""
          type="password"
          class="input"
        />
        <span>your image Url</span>
      </label>
      <label>
        <input
          id="git"
          required=""
          placeholder=""
          type="password"
          class="input"
        />
        <span>your github Link</span>
      </label>
      <p>{message}</p>
      <button
        class="submit"
        onClick={(e) => {
          e.preventDefault();
          if (
            verif({
              userName:
                document.getElementById("fName").value +
                "_" +
                document.getElementById("lName").value,
              email: document.getElementById("email").value,
              password: document.getElementById("pass").value,
              confirmpass: document.getElementById("cpass").value,
              imageUrl: document.getElementById("img").value,
              githubLink: document.getElementById("git").value,
            }) === true
          ) {
            navigate("/login");
          }
        }}
      >
        Submit
      </button>
      <p class="signin">
        Already have an acount ?
        <a
          onClick={() => {
            navigate("/login");
          }}
        >
          LOGIN
        </a>
      </p>
    </form>
  );
};

export default SignUp;
